pragma solidity ^0.5;

import "./SimpleTokenSale.sol";
import "./BEP20Mintable.sol";

contract TokenRegistry {

  mapping(address  => address []) public tokens ;
  mapping (address => bool) public wasCreated;
  address payable public owner;
  uint256 public fee;


  event TokenCreated(address indexed creator, address tokenContract);

  constructor() public {
    owner = msg.sender;
    fee=100000000000000000;
  }

  function lastTokens () public view returns(uint8 ,address,address,address,address,address){
    address [] storage userTokens=tokens[msg.sender];
    address[] memory response=new  address[](5);
    // we want to index starting from 1
    uint256 start=userTokens.length+1;
    uint256 end;
    if(start<=5){
      end=1;
    }else{
      end=start-5;
    }
    uint8 i=0;
    while(start>end){
      --start;
      response[i++]=userTokens[start-1];
    }
    return (i,response[0],response[1],response[2],response[3],response[4]);


  }

  function _notifyTokenCreation(IBEP20 bep20) internal{
    tokens[msg.sender].push(address(bep20));
    wasCreated[address(bep20)]=true;
    emit TokenCreated(msg.sender, address(bep20));
  }

  function createSimpleToken(string memory name, string memory symbol, uint8 decimals, uint256 supply,bool burnable) public payable {
    require(msg.value>=fee,"Registry: Insufficient fee");
    IBEP20 bep20 = new BEP20(name, symbol, decimals,supply,burnable);
    _notifyTokenCreation(bep20);
  }

  function createMintableUncappedToken(string memory name, string memory symbol, uint8 decimals, uint256 supply,bool burnable) public payable {
    require(msg.value>=fee,"Registry: Insufficient fee");
    IBEP20 bep20 = new BEP20Mintable(name, symbol, decimals,supply,burnable,0);
    _notifyTokenCreation(bep20);
  }

  function createMintableCappedToken(string memory name, string memory symbol, uint8 decimals, uint256 supply, bool burnable,uint256 cap) public payable {
    require(msg.value>=fee,"Registry: Insufficient fee");
    require( cap>0,"Registry: CappedTokensale cap==0");
    BEP20 bep20 = new BEP20Mintable(name, symbol, decimals,supply,burnable,cap);
    _notifyTokenCreation(bep20);
  }
    function withdraw() public payable{
    require(msg.sender==owner,"Registry: Only owner");
    owner.transfer(address(this).balance);
  }

  function setFee(uint256 _fee) public {
    require(msg.sender==owner,"Registry: Only owner");
    fee=_fee;
  }

}
